import React from 'react';
import { Link } from 'react-router-dom';

import './Carousel.css'

const Carousel = ({ tags }) => {
    var buttons = [];
    for (var i; i < tags.length; i++) {
        buttons.add(
            <div>
                <div className="external-button">
                    {tags[i]}
                </div>
            </div>
        )
    };

    return(
        <div>
            {buttons}
        </div>
    );
}

export default Carousel;
